import React from 'react';

import './LoginPage.css';

function LoginPage () {

  return(
    <div className = "login-container">
      <div className = "input-form">
        <input 
          placeholder = "username"
        />
        <input 
          type = "password" 
          placeholder = "password"
        />
        <button>Login</button>
      </div>
    </div>
  )
}

export default LoginPage;
